// Portfolio.jsx
import { featuredPortfolio } from '../../data.js';
import CardCarousel from '../cardCarousel/Carousel.jsx'; // import your CardCarousel component
import './portfolio.scss';

function Portfolio() {
  return (
    <div className="portfolio">
        <div className="container">
            <CardCarousel items={featuredPortfolio} />
        </div>
    </div>
  );
}

export default Portfolio;
